cards.desc:
Para efetuar a associação entre centro de custos e locais de négocio com grupo de clientes, DDD’s e áreas de atuação deverá ser criado um CRUD para manipulação desses registros.


- Ao selecionar a UF, os valores para área de atuação deverão ser modificados para somente exibir as áreas de atuação da UF selecionada;

- Ao selecionar a área de atuação, os valores para DDD deverão ser modificados para somente exibir os DDDs da área de atuação selecionada;

- Durante uma edição, os campos UF, Área de atuação e DDD deverão aparecer desabilitados. Ou seja, não deve ser possível modificar os valores;

- A lista de campos de preenchimento de grupos de cliente é dinâmica, ou seja, se um novo grupo de cliente for cadastrado no IW, deverá aparecer automaticamente;

- Não deve ser possível inserir o registro caso a UF, área de atuação e DDD já esteja cadastrada no banco de dados;

- Os valores digitados para o campo local de negócio devem ser validados para somente permitir a digitação de locais de negócio válidos;

- Os valores digitados para os campos de grupo de cliente devem ser validados para somente permitir a digitação de grupos de cliente válidos;

- O preenchimento de todos os campos é obrigatório.

